import GlobalNav from './GlobalNav'
import Axios from "axios";
import * as UTILS from "../utils";
import { navigate } from "@reach/router";
import PaintingButton from "./PaintingButton";


export default class Painting extends Component {
    constructor(props) {
        super(props);

        this.state = { painting:[] };

      }

      // getDesignInfo = e => {
      //   navigate(`/IndividualArtwork/${this.props.id}`)





      // };

      componentDidMount(){
        Axios.get(UTILS.category_painting_url).then(
          res => {
            if (res.data.result === false) {
              this.setState({ result: false });
            } else {
              console.table(res.data)
              this.setState({painting: res.data, result: true });
            }
          },

        );

      }

    render() {
        return (
            <React.Fragment>
                <GlobalNav />

                    {this.state.photography.map((photography, i) => {
      return  <li key={photography.price}>
      <PhotographyButton photography_title={photography.artwork_title} id={photography.id} />
    </li> 



    })}
            </React.Fragment>

        )
    }
}
